import React from "react";
import Modal from "./components/CustomCard";
import HomePage from "./components/app";
// import './App.css';

function App() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        padding: "25px",
        flexWrap: "wrap-reverse",
      }}
    >
      <HomePage />
      <Modal />
      <Modal />
      <Modal />
      <Modal />
    </div>
  );
}

export default App;
